pragma solidity ^0.4.17;

contract Promoto {

    struct Artist {
        string name;
        string artistType;
        bool isValidArtist;
    }

    mapping(address => string) private users;
    mapping(address => Artist) private artists;

    address[] private usersList;
    address[] private artistsList;

    function register(string _name) public {
        users[msg.sender] = _name;
        usersList.push(msg.sender);
    }

    function getNumberOfUsers() public view returns(uint) {
        return usersList.length;
    }

    function becomeAnArtist(string _artistType) public {
        require(artists[msg.sender].isValidArtist);
        artists[msg.sender] = Artist(users[msg.sender], _artistType, true);
        artistsList.push(msg.sender);
    }

    function getNumberOfArtists() public view returns(uint) {
        return artistsList.length;
    }
}
